interface InputProps {
  value: string;
  onChange: (e: React.ChangeEvent<HTMLInputElement>) => void;
}

const Input = ({ value, onChange }: InputProps) => (
  <input
    onChange={onChange}
    value={value}
    className="h-10 border rounded-md focus:outline-none"
  />
);

export default Input;
